package cps161_lu5;

public class Nestedloop {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		for (int i = 1; i <= 10; i++) 
		{
			System.out.println("i is:  " + i);
			for(int j = 1; j <= 10; j++) 
			{
				System.out.println("j is: " + j);
			}
			System.out.println();
		}

	}

}
